script: |
  super -f text -I q4333.spq | sort > q4333.out

inputs:
  - name: q4333.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( + col0 ) IN ( + + CAST ( - col0 AS REAL ), col1, 53 + + col0, - col2 + - col2 * - col0 * + col0 * + + 36 );
  - name: tab2

outputs:
  - name: q4333.out
    data: |
      46	51	23
      64	77	40
      75	67	58
